import React from 'react'

const MakeName = ({ data, handleClick }) => {

  data.map((baby) => {
    return (
      <span
        className={baby.sex === 'f' ? 'girl' : 'boy'}
        onClick={() => {
          handleClick(baby)
        }}
      >
        {baby.name}
      </span>
    )
  })
}

export default MakeName
